    'гот': 'Гот - представитель готической субкультуры, вдохновлённый эстетикой готического романа, эстетикой смерти, готической музыки и относящий себя к готик-сцене.',
    'ре': 'Ре - 1) Один из музыкальных звуков, вторая ступень основного диатонического звукоряда 2) Название такой ноты',
    'ик': 'Ик - 1) употребляется для обозначения звука, издаваемого при икоте 2) Икота как действие',
    'летник': 'Летник - 1) Название для декоративных садовых растений, разводимых посредством посева на лето, в отличие от зимующих 2) ист. Летняя женская одежда в древней Руси  3) обл. Летняя дорога ',
    'абака': 'Абака - 1) верхняя часть колонны, плита на капители, теперь назыв. тарелкой, 2) пенька из волокон бананового дерева, манильская пенька, индийский лен, 3) доска для чертежей и математ. вычислений у римлян 4) Многолетнее тропическое растение сем. банановых, из волокна которого (так наз. манильской пеньки) изготовляют корабельные снасти, канаты, веревки',
    'оплетка': 'Оплётка - 1) процесс действия по гл. оплести, оплетать 2) То, чем оплетается что-либо.',
